import React, { useEffect, useState } from "react";
import Header from "../../components/header/header";
import "./contratos.css";
import AssignmentIcon from "@mui/icons-material/Assignment";
import TaskIcon from "@mui/icons-material/Task";
import PostAddIcon from "@mui/icons-material/PostAdd";
import { saveAs } from "file-saver"; // Importar a função saveAs do file-saver
import "react-pdf/dist/esm/Page/AnnotationLayer.css";
import DownloadIcon from "@mui/icons-material/Download";
import DeleteIcon from "@mui/icons-material/Delete";
import { useLocation } from "react-router-dom";
import { toast } from "react-toastify";
import ButtonText from "../../components/button-texto/index";
import ButtonIcon from "../../components/button-icon/index";

const Contrato = () => {
  const location = useLocation();
  const cliente = location.state && location.state.cliente;
  const idioma = location.state && location.state.idioma;
  const [arquivoSelecionado, setArquivoSelecionado] = useState(null);

  const arquivos = [
    {
      id: 1,
      nome: "Contrato teste",
      tipo: "pdf", // ou 'jpg', 'png', etc.
      conteudo:
        "",
    },
    {
      id: 2,
      nome: "Imagem teste",
      tipo: "png",
      conteudo:
        "",
    },
  ];

  const handleProcurarChange = (event) => {
    setArquivoSelecionado(event.target.files[0]);
  };

  const handleAnexarClick = () => {
    if (arquivoSelecionado) {
      setArquivoSelecionado(null); // Limpar o arquivo selecionado após anexar
    }
  };

  const handleExcluirClick = (id) => {
    toast.success("Anexo removido com sucesso!");
  };

  const handleDownload = (arquivo) => {
    if (arquivo.tipo === "pdf") {
      downloadPDF(arquivo.conteudo, `${arquivo.nome}.pdf`);
    } else if (arquivo.tipo === "jpg" || arquivo.tipo === "png") {
      downloadImage(
        arquivo.conteudo,
        `${arquivo.nome}.` + arquivo.tipo,
        arquivo.tipo
      );
    }
  };

  // Função para converter e baixar arquivo PDF
  const downloadPDF = (base64Data, fileName) => {
    const byteCharacters = atob(base64Data);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: "application/pdf" });

    saveAs(blob, fileName);
  };

  // Função para converter e baixar arquivo de imagem (JPG ou PNG)
  const downloadImage = (base64Data, fileName, fileType) => {
    const byteCharacters = atob(base64Data);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: `image/${fileType}` });

    saveAs(blob, fileName);
  };

  return (
    <>
      <div className="container-associados">
        <Header cliente={cliente} idioma={idioma} />
        <div className="container-contrato-associado">
          <div className="icones-nome">
            <label>
              <AssignmentIcon fontSize={"small"} />
              {cliente.nome} Nº do Contrato - {cliente.n_contrato}
            </label>
          </div>
          <div className="container-contratos">
            <div className="tipo-contrato-associado">
              <div className="contrato-associados-anexo">
                <label>Adicionar</label>
                <div className="document">
                  <a>
                    <PostAddIcon fontSize={"large"} />
                  </a>
                  <input type="file" onChange={handleProcurarChange} />
                  <ButtonText title="ANEXAR" funcao={handleAnexarClick} />
                </div>
              </div>

              <div className="document2">
                {arquivos.map((arquivo, index) => (
                  <div key={index}>
                    <div className="contrato-associados">
                      <TaskIcon />
                      <label> {arquivo.nome}</label>
                      <div className="baixa-delete-contrato">
                        <div className="deleta-contrato">
                          <ButtonIcon
                            icon={<DeleteIcon fontSize={"small"} />}
                            funcao={() => handleExcluirClick(arquivo.id)}
                          />
                        </div>
                        <div className="baixa-contrato">
                          <ButtonIcon
                            icon={<DownloadIcon fontSize={"small"} />}
                            funcao={() => handleDownload(arquivo)}
                          />
                        </div>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
          <div>
            <ul></ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default Contrato;
